import React from "react";

const styles = {
    photo: {
        width: "100%",
        height: "100%",
        cursor: "pointer"
    }
}

const Photo = props => (
    <img src={props.url} 
    style={styles.photo }
    alt="#">
    </img>
);

export default Photo;
